/* normalize */
body { 
    margin: 0; 
    position: relative;
    width: 100%;
    min-height: 100vh;
    background-color: #fdfdf4;
    display: flex;
    align-items: center;
}

/* global styles */
video {
  background-color: #111;
  width: 100%;
  border-radius: 10px;
  border: solid 10px #c29a74;
}
.data {
  display: none;
}
.heading {
  text-align: center;
  margin-bottom: 0;
}

.note {
  text-align: center;
}

.meta {
  text-align: center;
  font-size: .8rem;
  color: gray;
}

.container {
  margin-left: auto;
  margin-right: auto;
  width: 980px;
}

/* p2p-media styles */
.p2p-media {
  display: flex;
  align-items: center;
  flex-direction: column;
}

.p2p-media .remote-stream {
  width: 50%;
}

.p2p-media .local-stream {
  width: 30%;
}

/* p2p-data styles */
.p2p-data {
  display: grid;
  grid-template-columns: 30% 1fr;
  margin: 0 8px;
}

.p2p-data .messages {
  background-color: #eee;
  min-height: 100px;
  padding: 8px;
  margin-top: 0;
}

/* room */
.room {
  display: grid;
  grid-template-columns: 30% 40% 30%;
  gap: 8px;
  margin: 20px;
  background-color: #fdfdf4 ;
}

.room .remote-streams {
  background-color: #fdfdf4;
}

.room .messages {
  background-color: #eee;
  min-height: 100px;
  padding: 8px;
  margin-top: 0;
}

